import React, { useState } from 'react';
import { BsChevronCompactLeft, BsChevronCompactRight } from 'react-icons/bs';
import { RxDotFilled } from 'react-icons/rx';
 



const Carousel = () => {

    const slides = [
        {
            image:'./src/Componemts/Image/Two.jpg'
        },
        {
            url:'https://ceconline.edu/wp-content/uploads/2022/07/1-pic1-01-scaled.jpeg'
        },
        {
            url:'https://ceconline.edu/wp-content/uploads/2022/07/1-final.png'
        }
    ]
  return (
    <div className='h-screen w-screen relative bg-transparent  '>
        <div style={{backgroundImage:`url(${slides[0].image})`}} className='h-full mx-0  object-cover'></div>
    </div>
  )
}

export default Carousel
